window.bookSummaryJSON = "<p><b>Jessie Heaton is a fearless, flame-haired computer hacker. Independent and feisty, she’s relied on no one but herself since the age of sixteen.</b></p> <p>Working for the Russians, she is finally close to getting the one thing she wants most in life, when she’s stopped in her tracks by the notorious Ryan brothers.</p> <p>The Ryans are Irish Mafia. They are unstoppable. No one stands in their way. And nothing comes between a Ryan and his family.</p> <p>That is, until the hurricane that is Jessie crashes into their lives. With a world full of secrets and a past that she can’t outrun, will she be their salvation or their downfall?</p> <p><i>Ryan Rule</i> is book one in the New York Ruthless series, a reverse harem, dark mafia romance. It deals with mature themes that may be triggering for some listeners, and it ends on a cliffhanger.</p>"; 
